import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <div>
        <form>
          <div>
            <input
              data-testid="email-input"
              type="email"
              name="email"
              onChange={({ target: { name, value } }) => this.setState({ [name]: value })}
              placeholder="email"
            />
            <input
              data-testid="password-input"
              type="password"
              name="password"
              onChange={({ target: { name, value } }) => this.setState({ [name]: value })}
              placeholder="senha"
            />
          </div>
          <button
            name="submit"
            type="submit"
            value="Entrar"
          >
            </button>
        </form>
      </div>
    );
  }
}

export default Login;
